import styled from "styled-components";


export const Wrapper = styled.div `
	display:flex;
	font-size: 1em;
	height: 100vh;
	width: 100vw;
	text-align: center;

`;

export const Content = styled.div `
	margin: auto;
	width: 100%;
	height: 100%;
	background-color: #3776ab;
	padding-top:8em;
	position:relative;
    .form {
      padding-bottom: 5em;
    }

`;
export const Nav = styled.div `
	border-right: solid black 1px ;
	padding: 1rem;
	width: 20%;
	height: 100%;
	position:absolute;
	top:0;
	left:0;

`;
